import React from "react";
import './style.css';

const Card = ({data}) => {
    return(
    <div classname="card">
      <img src="..." classname="card-img-top" alt="..."/>
      <div classname="card-body">
        <h5 classname="card-title">{data.title}</h5>
        <p classname="card-text">{data.description}</p>
      </div>
    </div>
  )
}

export default Card
